// src/pages/Careers/Careers.js
import React from 'react';

const Careers = () => {
  return (
    <div className="py-20">
      <div className="container mx-auto px-4">
        <h1 className="text-4xl font-bold mb-8">Careers</h1>
        <p>Careers page content coming soon...</p>
      </div>
    </div>
  );
};

export default Careers;
